import '../../data/models/last_price_dto.dart';class LastPrice {  LastPrice({    this.fromDay,    this.toDay,    this.salary,  });  LastPrice.fromJson(dynamic json) {    fromDay = json['fromDay'];    toDay = json['toDay'];    salary = json['salary'];  }  int? fromDay;  int? toDay;  double? salary;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['fromDay'] = fromDay;    map['toDay'] = toDay;    map['salary'] = salary;    return map;  }  factory LastPrice.fromDto(LastPriceDto json) {    return LastPrice(      fromDay: json.fromDay,      toDay: json.toDay,      salary: json.salary,    );  }}